function Home({ handleLogout }) {
  const user = JSON.parse(localStorage.getItem('user'));
  
  return (
    <div style={{ textAlign: 'center', marginTop: '2rem' }}>
      <h1>Welcome, {user ? user.name : 'Guest'}</h1>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
}

export default Home;
